/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import Nav from "../components/Nav";
import Dune from "../images/dune.jpg";
import CircleText from "../components/CircleButton"
import React from "react";
import "./home.scss";
import CircleButton from "../components/CircleButton";

const HomeBackground = styled.div`
  background: url(${Dune}) no-repeat center center fixed;
  background-size: cover;
  font-size: 24px;
  color: white;
  font-weight: bold;
`;

const HomeDiv = styled.div`
  border-style: solid;
  border-width: 2px;
  border-color: #aeff00;
  bottom: 0;
  margin: 0px 30px;
`;

function Home() {
  return (
    <HomeBackground>
      <HomeDiv>
      <Nav />
      <img src={Dune}/>
      <p>John Schriemer</p>
      <CircleButton />
      </HomeDiv>
    </HomeBackground>
  );
}

export default Home;
